import React from 'react';
import { useState, setResponse, database } from 'react';


import ReactDropzone from 'react-dropzone';

function UploadData() {
    const onDrop = (acceptedFiles) => {

        const res = fetch('/upload-database', {
            method: 'POST',
            body: JSON.stringify(acceptedFiles), // "database" is the data you want to send
            headers: { 'Content-Type': 'application/json' },
          });
          const data = res.json();
          setResponse(data);
  }

  return (
    <ReactDropzone onDrop={onDrop}>
      {({ getRootProps, getInputProps }) => (
        <section>
          <div {...getRootProps()}>
            <input {...getInputProps()} />
            <p>Drag 'n' drop some files here, or click to select files</p>
          </div>
        </section>
      )}
    </ReactDropzone>
  );
}
export default UploadData;
